
DROP SCHEMA IF EXISTS `division_politica` ;
CREATE SCHEMA IF NOT EXISTS `division_politica`
	DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci ;
USE `division_politica` ;

DROP TABLE IF EXISTS `division_politica`.`division` ;
CREATE TABLE IF NOT EXISTS `division_politica`.`division` (
  `provincia` INT NOT NULL,
  `canton` INT NOT NULL,
  `distrito` INT NOT NULL,
  `seq_distrito` INT NOT NULL,
  `nombre` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`provincia`, `canton`, `distrito`))
ENGINE = InnoDB;
select nombre from division_politica.division;
select provincia,canton,distrito,seq_distrito,nombre from division_politica.division;
